import React from 'react';
import styles from "./IPhone.module.scss";
import {UiButton, UiIcons, UiTime} from "../UI";
import IPhone from "../../images/IPhone.png";
import Logo from "../../images/Logo.jpg";
import {NavLink} from "react-router-dom";

export const AuthorizationSuccess = () => {
    return (
        <div className={styles.authorization_success}>
            <div className={styles.authorization_success__flex}>
                <div className={styles.time}>
                    <UiTime color='white'/>
                </div>
                <div className={styles.icons}>
                    <UiIcons/>
                </div>
            </div>
            <h1 className={styles.authorization_success__head}>
                Authorization success
            </h1>
            <p className={styles.authorization_success__bot}>
                You logged in
            </p>
            <img
                alt="Downloading..."
                className={styles.iphone}
                src={IPhone}/>
            <UiButton
            onClick={()=>console.log("log")}
            className={styles.iphone_login}
            padding='16px 146px'
            name='Log in'
            color='#FFCA42'/>
        </div>
    );
};
